 v = createVector(4, 6); // incoming vector, this example vector is heading to the right and downward\\nlet n = createVector(0, -1); // surface normal to a plane (this example normal points directly upwards)\\nv.reflect(n); // v is reflected about the surface normal n.  v's components are now set to [4, -6]\\n</code>\\n</div>\\n\\n<div>\\n<code>\\nfunction draw() {\\n  background(240);\\n\\n  let v0 = createVector(0, 0);\\n  let v1 = createVector(mouseX, mouseY);\\n  drawArrow(v0, v1, 'red');\\n\\n  let n = createVector(0, -30);\\n  drawArrow(v1, n, 'blue');\\n\\n  let r = v1.copy();\\n  r.reflect(n);\\n  drawArrow(v1, r, 'purple');\\n}\\n\\n// draw an arrow for a vector at a given base position\\nfunction drawArrow(base, vec, myColor) {\\n  push();\\n  stroke(myColor);\\n  strokeWeight(3);\\n  fill(myColor);\\n  translate(base.x, base.y);\\n  line(0, 0, vec.x, vec.y);\\n  rotate(vec.heading());\\n  let arrowSize = 7;\\n  translate(vec.mag() - arrowSize, 0);\\n  triangle(0, arrowSize / 2, 0, -arrowSize / 2, arrowSize, 0);\\n  pop();\\n}\\n</code>\\n</div>\"],\"class\":'p5.Vector',module:'Math',submodule:'Vector'},{file:'src/math/p5.Vector.js',line:1452,description:'<p>Return a representation of this vector as a float array. This is only\\nfor temporary use. If used in any other fashion, the contents should be\\ncopied by using the <b>p5.Vector.<a href=\"#/p5.Vector/copy\">copy()</a></b> method to copy into your own\\narray.</p>\\n',itemtype:'method',name:'array',\"return\":{description:'an Array with the 3 values',type:'Number[]'},example:['\\n<div class = \"norender\">\\n<code>\\nfunction setup() {\\n  let v = createVector(20, 30);\\n  print(v.array()); // Prints : Array [20, 30, 0]\\n}\\n</code>\\n</div>\\n\\n<div class=\"norender\">\\n<code>\\nlet v = createVector(10.0, 20.0, 30.0);\\nlet f = v.array();\\nprint(f[0]); // Prints \"10.0\"\\nprint(f[1]); // Prints \"20.0\"\\nprint(f[2]); // Prints \"30.0\"\\n</code>\\n</div>'],\"class\":'p5.Vector',module:'Math',sub